import React from 'react'
import { useGlobalContext } from './context'

const Movies = () => { 
  const {movie} = useGlobalContext();
  return (
    <div>
      {
        movie.map((curr) => {
          return (
          <div>
          <h2>{curr.Title}</h2>
          </div>
        )})
      }
    </div>
  )
}

export default Movies;
